import React from 'react';
import './HeroSection.css';

const HeroSection = () => {
  return (
    <div className="hero-container">
      {/* Left sidebar with title */}
      <div className="sidebar">
        <h1 className="main-title">Moving Deposit Payment Options</h1>
        <p className="tagline">Making your move simple</p>
      </div>

      {/* Hero section with payment options */}
      <div className="hero-section">
        <div className="hero-image">
          <div className="hero-text">
            <h2>Moving Should be Easy</h2>
            <p>We created this website to make paying your moving deposit easier. Moving is stressful enough so we try everything to make it less stressful! Use the links on the top left to find a payment option that works for you!</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default HeroSection;
